import string
import pyperclip

def generate_passwords(length):
    passwords = []
    for char in string.ascii_letters + string.digits + string.punctuation:
        for password in product(string.ascii_letters + string.digits + string.punctuation, repeats=length):
            password_str = ''.join(password) + char
            passwords.append(password_str)
    return passwords

def try_passwords(passwords, target):
    for password in passwords:
        pyperclip.copy(password)
        if target in get_clipboard():
            print(f"Found password: {password}")
            break

def get_clipboard():
    return pyperclip.paste()

def main():
    length = int(input("Enter the password length: "))
    target = input("Enter the target password: ")
    passwords = generate_passwords(length)
    try_passwords(passwords, target)

if __name__ == "__main__":
    main()
```

